webpackJsonp([0xbd01f9ae0129],{5327:function(t,e){t.exports={data:{post:{html:"<p>Mama checked in from Verona this evening (via hotel phone, so we kept it short). She was at a do-it-yourself pasta restaurant this afternoon. Do-it-yourself as in here's an egg, 100 g flour, and a rolling pin. Roll it yourself. I had to think of <a href=\"http://www.vfth.com\">Al</a> as she was telling me this. So maybe now she'll know what to do with that pasta machine we've had sitting around for years.</p>",fields:{title:"Roll Your Own",date:"30 Aug 2001",url:"https://papascott.de/2001-08-30-roll-your-own/"}}},pathContext:{slug:"/2001-08-30-roll-your-own/",prev:{fields:{title:"Verona",date:"29 Aug 2001",slug:"/2001-08-29-verona/"}},next:{fields:{title:"Layover at Home",date:"02 Sep 2001",slug:"/2001-09-02-layover-at-home/"}}}}}});
